    //     setIsLoading(false);
    //   }
    //   fetchProductList();
    // }, []);
    return (
        <div className="products_container">
            <h2>대출 상품 목록 조회</h2>
        {/* {isLoading && <Spinner animation="border" variant="success" />} */}
            <table className="products_table">
                <thead>
                    <tr>
                        <th> 비교검색 </th>
                        <th> 순번 </th>
                        <th> 정책명 </th>
                        <th> 자금유형 </th>
                        <th> 보증한도 </th>
                        <th> 보증기간 </th>
                        <th> 기업소재지 </th>
                        <th> 지원기관 </th> 
                        <th> 이자율 </th>
                    </tr>
                </thead>
                <tbody> 
                {productApi &&
                    productApi.map((item, i) => (
                        <ListItems
                        key={i}
                        idx={item.idx}
                        productName={item.productName}
                        guarantee={item.guarantee}
                        liog={item.liog}
                        termgrt={item.termgrt}
                        seat={item.seat}
                        date={item.date}
                        interestRate={item.interestRate} />
                    ))}      
                </tbody>
            </table>
        </div>
    )
}

export default ProductsComponent
